class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        l=[]
        n=len(board)
        m=len(board[0])
        for i in range(n):
            x=[]
            for j in range(m):
                x.append((board[i][j],i,j))
            x.sort()
            l.append(x[-3])
            l.append(x[-2])
            l.append(x[-1])
        l.sort()
        l.reverse()
        s=l[-1][0]+l[-2][0]+l[-3][0]
        for i in range(3*n):
            for j in range(i+1,3*n):
                if l[i][1]==l[j][1] or l[i][2]==l[j][2]:
                    continue
                for k in range(j+1,3*n):
                    if l[i][1]==l[k][1] or l[i][2]==l[k][2] or l[j][1]==l[k][1] or l[j][2]==l[k][2]:
                        continue
                    else:
                        s=max(s,l[i][0]+l[j][0]+l[k][0])
        # print(l)

        return s
